import sys

def main():
    args = sys.stdin.readline().rstrip().split(" ")
    a = int(args[0])
    b = int(args[1])
    c = int(args[2])
    if a + b >= c:
        print("Yes")
    else:
        print("No")

if __name__ == '__main__':
    main()

